typedef GInstanceInitFunc
    = ffi.Pointer<ffi.NativeFunction<GInstanceInitFuncFunction>>;
typedef GInstanceInitFuncFunction = ffi.Void Function(
    ffi.Pointer<GTypeInstance> instance, gpointer g_class);
